import "./CarInstance.css"
import { Link } from 'react-router-dom';
import React from 'react'

interface Props {
  strImagePath: any,
  strMark: string,
  strPrice: string
}



export default CarInstance;

const CarInstance: React.FC<Props> = (props) => {
  return (
    <Link
      to={{
        pathname: "/car",
        state: { car: props }
      }}
      className="btn car-image-wrapper col-md-4 col-sm-6 col-12"
    >
      <img src={props.strImagePath} alt={props.strMark} />
      <p className="car-name">{props.strMark}</p>
    </Link>
  );
}


